messages.content:
Let's address each issue:

### 1. **Strikethrough Appearance on Headings:**

The strikethrough appearance might be due to the bottom border in combination with the visual style of the 'Rye' font, which has quirky letterforms. You can try adjusting or removing the border if it's not critical:

```css
.message.assistant h2 {
    font-family: 'Rye', cursive;
    color: var(--rust);
    font-size: 1.3rem;
    margin: 24px 0 16px 0;
    /* Adjust or remove this */
