    /* Or, adjust padding/border if you want to keep some visual separation */
    /* padding-bottom: 4px;
       border-bottom: 1px solid var(--border-medium); */
}
```

### 2. **Double Bullets:**

The double bullet issue occurs because the default list style is still visible. You need to remove the default bullet:

```css
.message.assistant ul {
    list-style-type: none; /* Remove default bullets */
    margin: 12px 0;
    padding-left: 0;
}

.message.assistant li {
    margin: 8px 0;
    padding-left: 20px;
    position: relative;
    list-style-type: none; /* Ensure no default bullets */
}

.message.assistant li::before {
    content: ''; 
    color: var(--red-primary);
    position: absolute;
    left: 0; /* Adjust if needed */
}
```

With these changes, the strikethrough effect should disappear if it was caused by the border, and the double bullets should be resolved. Let me know if there are any more issues!
